/* eslint-disable no-unused-vars */
import React, { useState, useEffect } from 'react';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import { Typography } from '@mui/material';
import DataTable from "react-data-table-component";
import GetShippo from '../helpers/GetShippo';

const ShippoItem = ({datosfinales}) => {

	const [data, setdata] = useState(null)

	GetShippo(datosfinales).then(response => setdata(response))

	console.log('SHIPPO:', data);

	const columnas = [
		{
		  name: "Carrier",
		  selector: (row) => row.provider,
		},
		{
		  name: "Currency",
		  selector: (row) => row.currency_local
		},
		{
		  name: "Rate",
		  selector: (row) => row.amount_local

		},
		{
		  name: "Service Level",
		  selector: (row) => row.servicelevel
		},
		{
		  name: "Transit Time",
		  selector: (row) => row.estimated_days,
		},

		{
		  name: "",
		  selector: (row) => <img src={row.provider_image_75} alt="carrier" width="60" height="60" />
		}
	  ];

	return (
		<>
			<Grid item xs={12}>
				<Paper >

					 <DataTable striped columns={columnas} data={data} />
				</Paper>
			</Grid>
			<br />
		</>
	);
};

export default ShippoItem;
